import React, { useContext } from 'react'
import UrlsContextProvider, { UrlsContext } from '../contexts/UrlsContext'

const IndexPage = () => {
  const { urls } = useContext(UrlsContext)

  return (
    <div>
      <UrlsContextProvider>
        <h1>Index Page</h1>
        {urls.map((url, index) => (
          <p>{url.url}</p>
        ))}
      </UrlsContextProvider>
    </div>
  )
}

export default IndexPage
